        public override void Load()
        {
            Main.dayTime = true;
            Main.time = 27000;
        }
        private void FirstAttempt(GenerationProgress progress)
        {
            bool success = false;
            int attempts = 0;
            while (!success)
            {
                attempts++;
                if (attempts > 1000)
                {
                    success = true;
                    continue;
                }
                int i = ((Main.maxTilesX / 2) - 17);
                int j = ((Main.maxTilesX / 2) - 20);
                success = FirstTimer(i, j, progress);
            }
        }
        private bool FirstTimer(int i, int j, GenerationProgress progress)
        {
            if (i != (Main.maxTilesX / 2) - 17 || j != (Main.maxTilesY / 2) - 20)
            {
                return false;
            }
            for (int y = 0; y < FirstTimeShape.GetLength(0); y++)
            {
                for (int x = 0; x < FirstTimeShape.GetLength(1); x++)
                {
                    progress.Set(0.5f);
                    int k = i + x;
                    int l = j + y;
                    if (WorldGen.InWorld(k, l))
                    {
                        Tile tile = Framing.GetTileSafely(k, l);
                        switch (FirstTimeShape[y, x])
                        {
                            case 0:
                                tile.active(false);
                                break;
                            case 1:
                                tile.type = (ushort)(ModContent.TileType<QuarrystoneAlt>());
                                tile.active(true);
                                break;
                            case 2:
                                tile.type = (ushort)(ModContent.TileType<Quarrystone>());
                                tile.active(true);
                                break;
                            case 3:
                                //light
                                tile.active(true);
                                break;
                            case 4:
                                tile.type = (ushort)(ModContent.TileType<QuarrystoneAlt>());
                                tile.active(true);
                                tile.slope(2);
                                break;
                            case 5:
                                tile.type = (ushort)(ModContent.TileType<QuarrystoneAlt>());
                                tile.active(true);
                                tile.slope(1);
                                break;
                            case 6:
                                tile.type = (ushort)(ModContent.TileType<QuarrystoneAlt>());
                                tile.active(true);
                                tile.halfBrick(true);
                                break;
                            case 7:
                                tile.type = (ushort)(ModContent.TileType<QuarrystoneAlt>());
                                tile.active(true);
                                tile.slope(3);
                                break;
                            case 8:
                                tile.type = (ushort)(ModContent.TileType<QuarrystoneAlt>());
                                tile.active(true);
                                tile.slope(4);
                                break;
                        }
                        switch (FirstTimeWallShape[y, x])
                        {
                            case 1:
                                tile.wall = WallID.Stone;
                                break;
                            case 2:
                                tile.wall = WallID.WoodenFence;
                                break;
                        }
                        switch (FirstTimeLiquidShape[y, x])
                        {
                            case 1:
                                tile.honey(true);
                                tile.liquid = 255;
                                break;
                        }
                    }
                }
            }
            return true;
        }
    }
